import React, { useState, useEffect } from 'react';
import { vitalsAPI } from '../../api/endpoints';

const ReadOnlyConsultationView = ({ consultation, onClose, currentUser }) => {
  const [vitals, setVitals] = useState(null);

  useEffect(() => {
    fetchVitals();
  }, []);

  const fetchVitals = async () => {
    try {
      if (consultation.patient_id) {
        const response = await vitalsAPI.getLatestVitals(consultation.patient_id);
        setVitals(response.data.vitals);
      }
    } catch (error) {
      console.error('Error fetching vitals:', error);
    }
  };

  const getExamData = () => {
    try {
      if (consultation.tests) {
        const parsed = JSON.parse(consultation.tests);
        return parsed;
      }
    } catch (error) {
      console.error('Error parsing exam data:', error);
    }
    return null;
  };

  const examData = getExamData();
  const examType = examData?.od_visual_acuity
    ? 'eye'
    : examData?.right_ear
    ? 'ent'
    : examData?.affected_area
    ? 'skin'
    : 'unknown';

  return (
    <div
      style={{
        position: 'fixed',
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        background: 'rgba(0, 0, 0, 0.8)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        zIndex: 1000,
        padding: '20px',
      }}
    >
      <div
        style={{
          background: '#1e1e2f',
          borderRadius: '12px',
          width: '90%',
          maxWidth: '800px',
          maxHeight: '90vh',
          overflow: 'auto',
          border: '1px solid #2a2d47',
        }}
      >
        <div
          style={{
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
            padding: '20px',
            borderBottom: '1px solid #2a2d47',
            background: '#2a2d47',
            borderRadius: '12px 12px 0 0',
          }}
        >
          <h3 style={{ margin: 0, color: '#ffffff', fontSize: '18px' }}>
            {examType === 'eye'
              ? '👁 Eye'
              : examType === 'ent'
              ? '👂 ENT'
              : examType === 'skin'
              ? '🩺 Skin'
              : '🏥 General'}{' '}
            Examination -{' '}
            {new Date(consultation.created_at).toLocaleDateString('en-US', {
              timeZone: Intl.DateTimeFormat().resolvedOptions().timeZone,
            })}
          </h3>
          <div style={{ display: 'flex', gap: '10px', alignItems: 'center' }}>
            {currentUser?.role === 'admin' && (
              <button
                onClick={() => {
                  /* delete logic */
                }}
                style={{
                  background: '#ff4757',
                  border: 'none',
                  padding: '8px 12px',
                  borderRadius: '6px',
                  color: 'white',
                  fontSize: '12px',
                  fontWeight: '600',
                  cursor: 'pointer',
                }}
              >
                Delete
              </button>
            )}
            <button
              onClick={onClose}
              style={{
                background: 'none',
                border: 'none',
                fontSize: '24px',
                cursor: 'pointer',
                color: '#ffa057',
                padding: '0',
                width: '30px',
                height: '30px',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                borderRadius: '50%',
              }}
            >
              ×
            </button>
          </div>
        </div>

        <div style={{ padding: '20px' }}>
          {/* Vital Signs */}
          {vitals && (
            <div
              style={{
                background: '#2a2d47',
                borderRadius: '8px',
                padding: '16px',
                marginBottom: '20px',
                border: '1px solid #3a3d5a',
              }}
            >
              <h4 style={{ color: '#ffa057', margin: '0 0 12px 0' }}>Vital Signs</h4>
              <div
                style={{
                  display: 'grid',
                  gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))',
                  gap: '12px',
                }}
              >
                <div>
                  <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Blood Pressure</label>
                  <div style={{ color: '#ffffff', fontWeight: '600' }}>{vitals.blood_pressure} mmHg</div>
                </div>
                <div>
                  <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Heart Rate</label>
                  <div style={{ color: '#ffffff', fontWeight: '600' }}>{vitals.heart_rate} bpm</div>
                </div>
                <div>
                  <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Temperature</label>
                  <div style={{ color: '#ffffff', fontWeight: '600' }}>{vitals.temperature}°C</div>
                </div>
                <div>
                  <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Weight</label>
                  <div style={{ color: '#ffffff', fontWeight: '600' }}>{vitals.weight} kg</div>
                </div>
              </div>
            </div>
          )}

          {/* Eye Examination */}
          {examType === 'eye' && (
            <>
              <div
                style={{
                  display: 'grid',
                  gridTemplateColumns: '1fr 1fr',
                  gap: '20px',
                  marginBottom: '20px',
                }}
              >
                <div
                  style={{
                    background: '#2a2d47',
                    borderRadius: '8px',
                    padding: '16px',
                    border: '1px solid #3a3d5a',
                  }}
                >
                  <h4 style={{ color: '#ffa057', margin: '0 0 12px 0' }}>Right Eye (OD)</h4>
                  <div style={{ display: 'grid', gap: '8px' }}>
                    <div>
                      <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Visual Acuity</label>
                      <div style={{ color: '#ffffff', fontWeight: '600' }}>{examData?.od_visual_acuity || 'Not recorded'}</div>
                    </div>
                    <div>
                      <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Cornea</label>
                      <div style={{ color: '#ffffff', fontWeight: '600' }}>{examData?.od_cornea || 'Not recorded'}</div>
                    </div>
                    <div>
                      <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Lens</label>
                      <div style={{ color: '#ffffff', fontWeight: '600' }}>{examData?.od_lens || 'Not recorded'}</div>
                    </div>
                    <div>
                      <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Retina</label>
                      <div style={{ color: '#ffffff', fontWeight: '600' }}>{examData?.od_retina || 'Not recorded'}</div>
                    </div>
                    <div>
                      <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Intraocular Pressure</label>
                      <div style={{ color: '#ffffff', fontWeight: '600' }}>{examData?.od_pressure || 'Not recorded'}</div>
                    </div>
                    <div>
                      <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Refraction</label>
                      <div style={{ color: '#ffffff', fontWeight: '600' }}>{examData?.od_refraction || 'Not recorded'}</div>
                    </div>
                  </div>
                </div>
                <div
                  style={{
                    background: '#2a2d47',
                    borderRadius: '8px',
                    padding: '16px',
                    border: '1px solid #3a3d5a',
                  }}
                >
                  <h4 style={{ color: '#ffa057', margin: '0 0 12px 0' }}>Left Eye (OS)</h4>
                  <div style={{ display: 'grid', gap: '8px' }}>
                    <div>
                      <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Visual Acuity</label>
                      <div style={{ color: '#ffffff', fontWeight: '600' }}>{examData?.os_visual_acuity || 'Not recorded'}</div>
                    </div>
                    <div>
                      <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Cornea</label>
                      <div style={{ color: '#ffffff', fontWeight: '600' }}>{examData?.os_cornea || 'Not recorded'}</div>
                    </div>
                    <div>
                      <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Lens</label>
                      <div style={{ color: '#ffffff', fontWeight: '600' }}>{examData?.os_lens || 'Not recorded'}</div>
                    </div>
                    <div>
                      <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Retina</label>
                      <div style={{ color: '#ffffff', fontWeight: '600' }}>{examData?.os_retina || 'Not recorded'}</div>
                    </div>
                    <div>
                      <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Intraocular Pressure</label>
                      <div style={{ color: '#ffffff', fontWeight: '600' }}>{examData?.os_pressure || 'Not recorded'}</div>
                    </div>
                    <div>
                      <label style={{ color: '#b8bcc8', fontSize: '12px' }}>Refraction</label>
                      <div style={{ color: '#ffffff', fontWeight: '600' }}>{examData?.os_refraction || 'Not recorded'}</div>
                    </div>
                  </div>
                </div>
              </div>

              {/* 👓 Refraction Test Results Section */}
              {consultation.exam_data?.refraction && (
                <div className="refraction-results" style={{ background: '#2a2d47', padding: '16px', borderRadius: '8px', border: '1px solid #3a3d5a' }}>
                  <h3 style={{ color: '#ffa057', marginBottom: '12px' }}>Refraction Test Results</h3>
                  <table className="refraction-table" style={{ width: '100%', borderCollapse: 'collapse', color: '#fff', marginBottom: '10px' }}>
                    <thead>
                      <tr>
                        <th style={{ borderBottom: '1px solid #3a3d5a', padding: '8px' }}>Right Eye (OD)</th>
                        <th style={{ borderBottom: '1px solid #3a3d5a', padding: '8px' }}>Left Eye (OS)</th>
                      </tr>
                    </thead>
                    <tbody>
                      {[
                        'autorefraction',
                        'retinoscopy',
                        'sphere',
                        'cylinder',
                        'axis',
                        'near_refraction',
                        'cycloplegic_refraction',
                        'final_rx',
                      ].map((field) => (
                        <tr key={field}>
                          <td style={{ borderBottom: '1px solid #3a3d5a', padding: '6px' }}>
                            {consultation.exam_data.refraction.right_eye[field]}
                          </td>
                          <td style={{ borderBottom: '1px solid #3a3d5a', padding: '6px' }}>
                            {consultation.exam_data.refraction.left_eye[field]}
                          </td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                  <p>Duochrome Result: {consultation.exam_data.refraction.duochrome_result}</p>
                  <p>Binocular Balance: {consultation.exam_data.refraction.binocular_balance}</p>
                  <p>Near Addition: {consultation.exam_data.refraction.near_addition}</p>
                  <p>Cycloplegic Agent: {consultation.exam_data.refraction.cycloplegic_agent}</p>
                  <p>Cycloplegic Time: {consultation.exam_data.refraction.cycloplegic_time}</p>
                  <p>Interpupillary Distance: {consultation.exam_data.refraction.interpupillary_distance} mm</p>
                  <p>Prescription Type: {consultation.exam_data.refraction.prescription_type}</p>
                  <p>Remarks: {consultation.exam_data.refraction.remarks}</p>
                </div>
              )}
            </>
          )}

          {/* Rest of your code remains unchanged (ENT, SKIN, etc.) */}
        </div>
      </div>
    </div>
  );
};

export default ReadOnlyConsultationView;
